Plot: Herman has a weakness for strip clubs. Donny has a thing for condiments and Tiffany is a newly celibate martial artist. These are Andy's new friends after he unsuspectingly follows his dream girl into a sexual addiction recovery group. At first this seems like the best possible news! However, Andy's professional and personal life begins to unravel as he deepens his ties to this lovable, but damaged group.




Cast: Josh Cooke ... Andy

Rob Benedict ... Donny

Lombardo Boyar ... Ramon

Kathrine Narducci ... Frannie

Christina DeRosa ... Lucy

Greg Germann ... Reeves

Kurt Fuller ... Bloom






